import React from 'react';

import './App.css';

import LayoutHeader from "./component/LayoutHeader";
import CardsDisplay from "./component/costEstimater";
import costEstimater from "./component/CardsDisplay";
const App = () => {
  return (
    <div className="App-container">
      <div className="vmc-header">
        <h1>HVC</h1>
      </div>
      <main className="vmc-layout-container">
        <article className="article-layout">
            <LayoutHeader></LayoutHeader>
            <CardsDisplay></CardsDisplay>
        </article>
        <aside className="asideLayout">
          <h1>costEstimater</h1>
            {/* <costEstimater></costEstimater> */}
        </aside>

      </main>
    </div>
  );
}

export default App;
